import {Text,View, Button,TextInput} from 'react-native'

export default class inputComponent extends Component {
    render() {
        this.subTitle = React.createRef()
        return(
            <View>
                <TextInput placeholder='intast' ref={this.subTitle}></TextInput>
                <Button onPress={console.log('asd')} title='Lav en ny title'></Button>
                <Text><h1>{this.subTitle}</h1></Text>
            </View>

        )
    }
}
